import React, {Component} from 'react';

class Holamundo extends Component{
    constructor(props){
        super(props);
    }
    render(){
        console.log("hola");
        return(
            <div className="Hola">
                <p>Hola Mundo</p>
            </div>
        )
    }   
}

export default Holamundo;
